import React from "react";

const chats = [
    {
        id: 1,
        title: 'M-Video'
    },        
    {
        id: 2,
        title: 'Mobilon'
    },
    {
        id: 3,
        title: 'Lenta'
    },
];

const Chats = (props) => {
    return(  
        <>      
        {chats.map(chat => 
            <button>{chat.title}</button>
        )}  
        </>  
    );
}

export default Chats;
